import { Dispatch, SetStateAction } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { Box, Container } from "./Common";
import SummaryPrompt from "./SummaryPrompt";
import { Question, Station } from "./types";

type SummaryProps = {
    updateIdx: Dispatch<SetStateAction<{ prev: number; curr: number }>>;
};

const Summary = (props: SummaryProps) => {
    return (
        <Container>
            <Box style={{ textAlign: "center", paddingBottom: "25px" }}>
                <SummaryPrompt />

                <br />

                <Link to="/OSCE/Station/Review">
                    <Start onClick={() => props.updateIdx({ prev: -1, curr: 0 })}>
                        Start Review
                    </Start>
                </Link>
            </Box>
        </Container>
    );
};

export default Summary;

const Start = styled.div`
    background-color: grey;
    width: 50%;
    border: 2px solid grey;
    border-radius: 5px;
    margin: 0 auto;
    padding: 1% 0;
    &:hover {
        cursor: pointer;
        border: 2px solid #fad000;
        color: #fad000;
    }
`;
